import React, { useState } from "react";

const PerDiemCalculator = () => {
  const [jobLocation, setJobLocation] = useState({ city: "", state: "", zip: "" });
  const [ratesArray, setRatesArray] = useState([]);
  const [selectedMonth, setSelectedMonth] = useState(null);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);

  // Your GSA API key and fixed fiscal year 2025
  const GSA_API_KEY = "BP2fPChQmadJd3ADlMYADSJqXT8CxFD6LZQh4KHt";
  const fiscalYear = "2025";

  const fetchStipendRates = async () => {
    setLoading(true);
    setError(null);
    setRatesArray([]);
    setSelectedMonth(null);

    let apiUrl = "";
    if (jobLocation.zip) {
      // Use ZIP code endpoint
      apiUrl = `https://api.gsa.gov/travel/perdiem/v2/rates/zip/${jobLocation.zip}/year/${fiscalYear}`;
    } else if (jobLocation.city && jobLocation.state) {
      // Use city/state endpoint
      apiUrl = `https://api.gsa.gov/travel/perdiem/v2/rates/city/${jobLocation.city}/state/${jobLocation.state}/year/${fiscalYear}`;
    } else {
      setError("Please provide either a ZIP code or both city and state.");
      setLoading(false);
      return;
    }

    try {
      const response = await fetch(apiUrl, {
        headers: {
          "X-API-KEY": GSA_API_KEY,
        },
      });
      const result = await response.json();
      const fetchedRates = result?.rates;

      if (!fetchedRates || fetchedRates.length === 0) {
        setError("No data found for this location/year.");
      } else {
        setRatesArray(fetchedRates);
        // Optionally default to the current month if available, otherwise use the first month in the array
        const currentMonth = new Date().getMonth() + 1; // e.g., April is 4
        const defaultMonth = fetchedRates.find(rate => parseInt(rate.month) === currentMonth) || fetchedRates[0];
        setSelectedMonth(defaultMonth);
      }
    } catch (err) {
      console.error("Error fetching rates:", err);
      setError("Failed to fetch data.");
    }
    setLoading(false);
  };

  const formatCurrency = (value) => `$${parseFloat(value).toFixed(2)}`;

  const handleMonthChange = (event) => {
    const monthValue = event.target.value;
    const selected = ratesArray.find(rate => rate.month === monthValue);
    setSelectedMonth(selected);
  };

  return (
    <div>
      <h2>üìç Per Diem Calculator</h2>
      <div>
        <label>City</label>
        <input
          type="text"
          value={jobLocation.city}
          onChange={(e) => setJobLocation({ ...jobLocation, city: e.target.value })}
        />
        <label>State (2-letter)</label>
        <input
          type="text"
          value={jobLocation.state}
          onChange={(e) => setJobLocation({ ...jobLocation, state: e.target.value.toUpperCase() })}
        />
        <label>ZIP Code (Optional)</label>
        <input
          type="text"
          value={jobLocation.zip}
          onChange={(e) => setJobLocation({ ...jobLocation, zip: e.target.value })}
        />
      </div>
      <button onClick={fetchStipendRates}>Fetch GSA Rates</button>
      {loading && <p>Loading...</p>}
      {ratesArray.length > 0 && (
        <div>
          <label>Select Month: </label>
          <select onChange={handleMonthChange} value={selectedMonth ? selectedMonth.month : ""}>
            {ratesArray.map((rate, index) => (
              <option key={index} value={rate.month}>
                Month {rate.month}
              </option>
            ))}
          </select>
        </div>
      )}
      {selectedMonth && (
        <div>
          <p>
            For Month {selectedMonth.month}:
            <br />
            üè† Housing (Daily): {formatCurrency(selectedMonth.value)}
            <br />
            üçΩÔ∏è M&IE (Daily): {formatCurrency(selectedMonth.meals)}
            <br />
            üí∞ Total Weekly: {formatCurrency((parseFloat(selectedMonth.value) + parseFloat(selectedMonth.meals)) * 7)}
          </p>
        </div>
      )}
      {error && <p>{error}</p>}
    </div>
  );
};

export default PerDiemCalculator;
